　【特長】<br>
1．一体型水滴受け<br>
端具と水滴受けを一体化した大型の樹脂脚キャップで、温室移動時の擦り傷や結露による水滴から大切な床を守ります。<br>
<br>
2．フリー棚<br>
左右の棚は別々の高さに調節でき(5cmピッチ)、鉢植えの大きさに合わせて上下できます。<br>
※使用荷重は棚板1枚につき5kgまでです。<br>
<br>
<br>
【サイズ】<br>
幅85.2×奥行43.5×高さ150cm(設置寸法/91×49×150cm)<br>
<br>
【仕様】<br>
・ 棚板6枚付き(16段階調節可) <br>
・ 支柱/アルミ製アルマイト仕上 <br>
・ 5号鉢×5鉢/1棚当り設置可 <br>
・ 組込みコンセント×2口装備<br>
・ 防摘コンセントカバー×2個 <br>
・ コンセントキャップ×2個 <br>
・ 総消費電力/1200wまで <br>
・ 総梱包数/2コ<br>
<br>
【備考】組立て品<br>
<br>
※画像はイメージです。花鉢等は商品に含まれません。<br>
<br>
